funcExec:
function funcExec() {
  const strEnd = "end of reserve/reserve";
  log("funcExec");
  contents_lnkBtnReserveOk.click();
  setTimeout(() => {
    logParam.message = strEnd;
    TZLOG(logParam, (data) => {});
    const ac = window.AndroidController;
    if (ac) ac.message(strEnd);
    location.href = "/Mobile/Member/LogOut.aspx";
  }, 1000);
}

